    "2016-11-25T21:06:06.829042",nt"name": "early-childhood-longitudinal-study-kindergarten-class-of-201011",nt"isopen":
    true,nt"url": null,nt"notes": "The Early Childhood Longitudinal Study,
    Kindergarten Class of 2010-11 (ECLS-K:2011), is part of the Early Childhood Longitudinal
    Study (ECLS) program; program data is available since 1998-99 at <http://nces.ed.gov/ecls/dataproducts.asp>.
    ECLS-K:2011 is a longitudinal study that focuses on childrenufffds early school
    experiences beginning with kindergarten and continuing through the fifth grade.
    It includes the collection of data from parents, teachers, school administrators,
    and before- and after-school  care providers, as well as direct child assessments
    of students. ECLS-K:2011 is exceptionally broad in its scope and coverage of child
    development, early learning, and school progress, drawing together information from
    multiple sources to provide rich data about the population of children who were
    kindergartners in the 2010-11 school year. The survey was conducted using computer-assisted
    interviews and paper questionnaires. The primary respondents in this study are students
    and their parents, general classroom teachers, special education teachers, school
    administrators, and before- and after-school care providers.",nt"license_title":
